import { Component } from "react";
class Backgorud extends Component {
  render() {
    return (
      <div className="Background-component">
        <h1>Brief backgorud</h1>
        <ul>
          <li>Birth year : 9 / 4 / 2001 </li>
          <li>Birth place : Soem Ngam / Lampang / 52210 </li>
          <li>Primary school : Lampang Kindergarten school</li>
          <li>Hight school : Soem Ngam hight school</li>
          <li>University : Chiang mai university</li>
        </ul>
      </div>
    );
  }
}

export default Backgorud;
